--populate readsets based on sequence_reads
FROM sequenceAnalysis.sequence_analyses a
GROUP BY a.sampleid, container,created,createdby,modified,modifiedby
);

go
--then update sequence_reads based on readsets
UPDATE sequenceAnalysis.sequence_reads
SET sequence_reads.readset = (
select sequence_readsets.rowid
from sequenceAnalysis.sequence_readsets
join sequenceAnalysis.sequence_analyses
on (sequence_analyses.sampleid=sequence_readsets.sampleid)
WHERE sequence_reads.analysis_id=sequence_analyses.rowid);

